import logo from "./logo.svg";
import "./App.css";
import React, { useEffect, useState } from "react";

function App() {
  const [recipe, setRecipe] = useState("none");
  const loadRecipe = () => {
    fetch("http://localhost:8000/recipes/")
      .then((response) => response.json())
      .then((data) => console.log(data))
      .then((data) => setRecipe(data));
    console.log(recipe);
  };

  useEffect(() => {
    loadRecipe();
  });

  return (
    <div>
      <h1>{recipe}</h1>
      <button onClick={loadRecipe}>Update</button>
    </div>
  );
}

export default App;
